import React from 'react';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';

function Customer({id, name, image, birthday, gender, job}) {
    return(
        <TableRow>
            <TableCell>{id}</TableCell>
            <TableCell><img src={image} alt='profile'/></TableCell>
            <TableCell>{name}</TableCell>
            <TableCell>{birthday}</TableCell>
            <TableCell>{gender}</TableCell>
            <TableCell>{job}</TableCell>
            <CustomerProfile id={id} name={name} image={image}/>
            <CustomerInfo birthday={birthday} gender={gender} job={job}/>
        </TableRow>
    )
}

function CustomerProfile({image, name, id}) {
    return(
        <div>
            <img src={image} alt='profile'/>
            <h2>{name}({id})</h2>
        </div>
    )
}

function CustomerInfo({birthday, gender, job}) {
    return(
        <div>
            <p>{birthday}</p>
            <p>{gender}</p>
            <p>{job}</p>
        </div>
    )
}
export default Customer;
